// src/App.js
import React from 'react';
import './App.css';
import WelcomePage from './components/Home';

function App() {
  return (
    <div className="welcome-page">
      <header className="header">
        <h1>Welcome to Witherfall</h1>
      </header>
    </div>
  );
}

export default App;
